import { Link } from "react-router-dom"

function Login(props) {
  return (
    <main>
      <section className="auth brd!">
        <form className="auth__form"
        // name={props.name}
        // noValidate
        // onSubmit={props.onSubmit}
        >
          {/* <h2 className="popup__title">{props.title}</h2> */}
          <h2 className="auth__title">Регистрация</h2>
          <input
            className="auth__item"
            name="email"
            type="text"
            placeholder="Email"
            minLength={2}
            maxLength={30}
            autoComplete="off"
            required
          // onChange={handleCardNameChange}
          // value={cardName}
          />
          <span className="input-error-name error" />
          <input
            className="auth__item"
            name="pass"
            type="type"
            placeholder="Пароль"
            required
            autoComplete="off"
          // onChange={handleCardLinkChange}
          // value={cardLink}
          />
          <span className="input-error-link error" />

          <button className="auth__button" type="submit">
            Зарегистрироваться
          </button>
          <p className="auth__text">Уже зарегистрированы?
            <Link className="auth__login-link" to="/sign-up" >
              Войти
            </Link></p>
        </form>
      </section>
    </main>

  )
}

export default Login
